import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../styles.css'; // Import the CSS file for styling

const TreeView = () => {
    const [godowns, setGodowns] = useState([]);
    const [items, setItems] = useState([]);
    const [selectedItem, setSelectedItem] = useState(null);
    const [expandedGodowns, setExpandedGodowns] = useState(new Set()); // Track expanded godowns

    useEffect(() => {
        axios.get('http://127.0.0.1:8000/api/godowns/')
            .then(response => {
                setGodowns(response.data);
            })
            .catch(error => {
                console.error("There was an error fetching the godowns!", error);
            });
    }, []);

    const handleExpandToggle = (id) => {
        const newExpandedGodowns = new Set(expandedGodowns);
        if (newExpandedGodowns.has(id)) {
            newExpandedGodowns.delete(id);
        } else {
            newExpandedGodowns.add(id);
            // Fetch items when a godown is expanded
            fetchItemsByGodown(id);
        }
        setExpandedGodowns(newExpandedGodowns);
    };

    const fetchItemsByGodown = (godownId) => {
        axios.get(`http://127.0.0.1:8000/api/items/`)
            .then(response => {
                const filteredItems = response.data.filter(item => item.godown === godownId);
                setItems(filteredItems);
            })
            .catch(error => {
                console.error("There was an error fetching the items!", error);
            });
    };

    const renderSubGodowns = (parentId) => {
        return godowns
            .filter(godown => godown.parent_godown === parentId)
            .map(godown => (
                <div key={godown.id}>
                    <button className="godown-button" onClick={() => handleExpandToggle(godown.id)}>
                        {godown.name}
                        <span className="expand-button">{expandedGodowns.has(godown.id) ? '-' : '+'}</span>
                    </button>
                    {expandedGodowns.has(godown.id) && renderSubGodowns(godown.id)}
                </div>
            ));
    };

    const handleItemClick = (item) => {
        setSelectedItem(item);
    };

    return (
        <div className="tree-view-container">
            <div className="sidebar">
                <h2>Godowns</h2>
                {godowns.filter(godown => godown.parent_godown === null).map(godown => (
                    <div key={godown.id}>
                        <button className="godown-button" onClick={() => handleExpandToggle(godown.id)}>
                            {godown.name}
                            <span className="expand-button">{expandedGodowns.has(godown.id) ? '-' : '+'}</span>
                        </button>
                        {expandedGodowns.has(godown.id) && renderSubGodowns(godown.id)}
                    </div>
                ))}
            </div>
            <div className="main-content">
                {selectedItem ? (
                    <div className="item-details">
                        <h3>{selectedItem.name}</h3>
                        <p>Quantity: {selectedItem.quantity}</p>
                        <p>Category: {selectedItem.category}</p>
                        <p>Price: ${selectedItem.price}</p>
                        <p>Status: {selectedItem.status}</p>
                        <p>Brand: {selectedItem.brand}</p>
                        <p>Type: {selectedItem.attributes.type}</p>
                        <p>Material: {selectedItem.attributes.material}</p>
                        <p>Warranty: {selectedItem.attributes.warranty_years} years</p>
                        <img src={selectedItem.image_url} alt={selectedItem.name} />
                    </div>
                ) : (
                    <div className="item-details">Select an item to see details.</div>
                )}
                <h3>Items</h3>
                <div>
                    {items.map(item => (
                        <button key={item.item_id} className="item-button" onClick={() => handleItemClick(item)}>
                            {item.name}
                        </button>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default TreeView;
